import React from 'react';
// import logo from './logo.svg';
import './App.css';
import Post from './Post';
function App() {
  return (
    <div class="App">
      <Post myId="1">ยานอวกาศอินไซต์สำรวจดาวอังคาร</Post>
      <Post myId="2">ถ่ายภาพหลุมดำไว้แล้ว สุดยอดไปเลย</Post>
      <Post myId="3">sdadada</Post>
    </div>
  );
}
export default App;
